import React from 'react';
import '../style/header.scss';

const PostCard = (title, preview, comments) => {

  return (
    <li className="postcard">
      <h3 className="postcard__title">{title}</h3>
      <p className="postcard__preview">{preview}</p>
      <div className="postcard__comments">{comments} Comments</div>
    </li>
  )
}

export default PostCard;
